import React from 'react';
import Common from './Common';

class Contact extends React.Component{
    constructor(props){
        super(props);
        this.changeHandle = this.changeHandle.bind(this);
    };

    changeHandle(e){
        alert(e.target.value);
    };

    render(){
        return (
            <>
            <div className="col-6">
            <Common 
                pageName="Contact Page" 
                description="This is Contact page Welcome here you are at right place"
            />
            </div>
            <div className="col-6">
                <form>
                    <h6>First Name : </h6>
                    <input type="text" name="firstName" onChange={this.changeHandle} />
                    Last Name : 
                    <input type="text" name="lastName" onChange={this.changeHandle} />
                    <input type="text" name="mobile" onChange={this.changeHandle} />
                </form>
            </div>
            </>
        );
    };
}

